import React from 'react';

const RouterPanel = (props) => {

    const routerStyle = {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'space-around',
        backgroundColor: '#E4F6F5',
        width: '18%',
      };


    return (<div style={routerStyle} >
                'Router List'
    </div>);
};

export default RouterPanel;
